
/* eslint global-require: "off" */
/* eslint-disable consistent-return */
import axios from 'axios';
import { Alert } from 'react-native';
import Communications from 'react-native-communications';
import { GoogleAnalyticsTracker } from 'react-native-google-analytics-bridge';
import * as logging from './logging';

const noImageIcon = 'data:image/png;base64,';
const addToCalendarIcon = 'data:image/png;base64,';
const collapseIcon = 'data:image/png;base64,';

const unineImgBig = 'data:image/png;base64,';

const examIcon='data:image/png;base64,';
const momentStatic = require('moment');
require('moment/locale/fr');

momentStatic.locale('fr');

const isConnected = async () => {
  try {
    const res = await axios.get('https://google.com');
    if (res.data) {
      return true;
    }
  } catch (e) {
    return false;
  }
};

const GAN = 'UA-116289625-1';

const trackScreenView = (screen) => {
  const tracker = new GoogleAnalyticsTracker(GAN);
  logging.logGA(`trackScreenView for ${screen}`);
  tracker.trackScreenView(screen);
};

/*
category (required): String, category of event
action (required): String, name of action
optionalValues: Object
label: String
value: Number
*/
const trackEvent = (category, action) => {
  const tracker = new GoogleAnalyticsTracker(GAN);
  logging.logGA(`trackEvent ${action} performed by :${category}`);
  tracker.trackEvent(category, action);
};

const gaParams = {
  screens: {
    home: 'home screen',
    map: 'map screen',
    local: 'local screen',
    cours: 'cours screen',
    building: 'building screen',
    person: 'person details',
    unit: 'unit person',
    info: 'info person',
    personL: 'persons in local screen',
    network: 'network error',
  },
  categories: {
    app: 'app',
    usr: 'user',
  },
  actions: {
    lapp: 'launch UniNE CAMPUS app',
    slid: 'snap slide',
    hmtp: 'homeMap marker tap',
    accl: 'add course event to calendar',
    aecl: 'add event to calendar',
    lplo: 'long press on local',
    cflr: 'change floor',
    cmtp: 'change mapType',
    sdml: 'send email ',
    otcl: 'outgoing call',
    skin: 'skipped intro',
    hmmx: 'homeMap maxmize tapped',
    sltp: 'slider tapped',
    home: 'back home',
    web: 'open web page',
    mypo: 'show my position',
    focu: 'focus out UniNE',
    foba: 'focus in building',
  },
};
const phonecall = (phone, flag) => {
  // Communications.phonecall(phone.external, true)
  Communications.phonecall(phone, flag);
  const { categories, actions } = gaParams;
  trackEvent(categories.usr, actions.otcl);
};

const email = (arrEmails) => {
  // Communications.email([email], null, null, ' ', ' ')
  Communications.email(arrEmails, null, null, ' ', ' ');
  const { categories, actions } = gaParams;
  trackEvent(categories.usr, actions.sdml);
};

const web = (url) => {
  const { categories, actions } = gaParams;
  trackEvent(categories.usr, actions.web);
  Communications.web(url);
};


const alterUser = (title, msg) => {
  Alert.alert(
    title,
    msg,
    [
      { text: 'OK', onPress: () => console.log('OK Pressed') },
    ],
    { cancelable: true },
  );
};

const NBR_OF_DAYS = 6;

export {
  noImageIcon,
  unineImgBig,
  addToCalendarIcon,
  momentStatic,
  isConnected,
  collapseIcon,
  gaParams,
  trackScreenView,
  trackEvent,
  phonecall,
  email,
  web,
  alterUser,
  NBR_OF_DAYS,
  examIcon
};
